css:
@-moz-document domain("medlineplus.gov") {
#mplus-content {
    padding: 1.42857em;
    background-color: #181c1d;
}body {
    background: linear-gradient(#191d1e 0%,#191d1e 20%,#191d1e 100%);}
#mplus-header #mplus-logo {

    background-color: #191d1e;
}#mplus-header #mplus-nav {
   
    background: linear-gradient(#191d1e 10%,#191d1e 75%);
}.provider-box {

    background-color: #191d1e;
}#mplus-footer .footer2 {
 
    background-color: #1a1e1f;
}#mplus-footer {
    background: #191d1e;
    
    border-top: .07143em solid #191d1e;
   
}article, aside, details, figcaption, figure, footer, header, hgroup, menu, nav, section {

    background-color: #191d1e;
}p, ul {
  
    color: #a2aeb0;
}b, strong, .bold-text, .strong-text {
    color: #49abc5;
   
}h1.with-also, .pageheader.with-also {
  
    color: #b55100;
}.side-section .section-body {

    border: .07143em solid #0082ca;
    background: #191d1e;
}.section .section-header .section-title h2 {
    
    color: #49abc5;
}#mplus-wrap {
    background: #191d1e;
  
}#topic #table-of-contents h3 {
 
    color: #49abc5;
}#toc-box {
    background: none repeat scroll 0 0 #191d1e;
    border: 1px solid #b24c00;
  
}
}
